import React from 'react';

export const Footer: React.FC = () => {
  return (
    <>
    <div className="max-w-screen-xl flex flex-wrap items-center justify-between mx-auto p-4">
    <footer>
      <p>© 2023 Moja strona główna. Wszystkie prawa zastrzeżone.</p>
    </footer>
    </div>
    </>
  );
};
